ALTER TRIGGER [dbo].[TR_CatalogDeleteTrigger] ON [dbo].[Catalog]
INSTEAD OF DELETE
AS
BEGIN
    DELETE FROM [dbo].[Item] WHERE CatalogId IN (SELECT CatalogId FROM [deleted])
    DELETE [dbo].[Category] FROM [dbo].[Category] c INNER JOIN [dbo].[CategoryBase] b ON b.CategoryId = c.CategoryId WHERE b.CatalogId IN (SELECT CatalogId FROM [deleted])
    DELETE FROM [dbo].[Property] WHERE CatalogId IN (SELECT CatalogId FROM [deleted])
    DELETE FROM [dbo].[PropertySet] WHERE CatalogId IN (SELECT CatalogId FROM [deleted])
    DELETE FROM [dbo].[Catalog] WHERE CatalogId IN (SELECT CatalogId FROM [deleted])
END
GO

IF object_id(N'[dbo].[FK_dbo.Item_dbo.PropertySet_PropertySetId]', N'F') IS NOT NULL
    ALTER TABLE [dbo].[Item] DROP CONSTRAINT [FK_dbo.Item_dbo.PropertySet_PropertySetId]
IF object_id(N'[dbo].[FK_dbo.Category_dbo.PropertySet_PropertySetId]', N'F') IS NOT NULL
    ALTER TABLE [dbo].[Category] DROP CONSTRAINT [FK_dbo.Category_dbo.PropertySet_PropertySetId]
ALTER TABLE [dbo].[Item] ALTER COLUMN [PropertySetId] [nvarchar](128) NULL
ALTER TABLE [dbo].[Item] ADD CONSTRAINT [FK_dbo.Item_dbo.PropertySet_PropertySetId] FOREIGN KEY ([PropertySetId]) REFERENCES [dbo].[PropertySet] ([PropertySetId])
ALTER TABLE [dbo].[Category] ADD CONSTRAINT [FK_dbo.Category_dbo.PropertySet_PropertySetId] FOREIGN KEY ([PropertySetId]) REFERENCES [dbo].[PropertySet] ([PropertySetId])
GO

